func minOperations(nums []int, target int) int {
    freq := make(map[int]int)
    for _, num := range nums {
        freq[num]++
    }

    var ops int
    for target > 0 {
        if target%2 == 1 {
            if freq[1] > 0 {
                freq[1]--
            } else {
                return -1
            }
        } else {
            if freq[target] > 0 {
                return ops
            }
        }
        target /= 2
        ops++
        nextFreq := make(map[int]int)
        for k, v := range freq {
            if k == 1 {
                nextFreq[1] += v
            } else {
                nextFreq[k/2] += v * 2
            }
        }
        freq = nextFreq
    }
    return ops
}
